import React from 'react';
import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import {newItem} from "../../../Redux/later-seen-reducer";
import NewDrinkOrder from "./NewDrinkOrder";


class NewDrinkOrderContainer extends React.Component {


    render() {
        this.props.newItem(this.props.drink[this.props.match.params.id -49])

        return (
            <NewDrinkOrder drink={this.props.drink} number={this.props.match.params.id - 49}/>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        drink: state.newDrinkPage.drink,


    }


}

export default compose(
    connect(mapStateToprops, {newItem}),
    withRouter,
)(NewDrinkOrderContainer)
